import clientone from "../imgs/Logo (1).png";
import clienttwo from "../imgs/Logo (2).png";
import clientthree from "../imgs/Logo (3).png";
import clientfour from "../imgs/Logo (4).png";
import clientfive from "../imgs/Logo (5).png";
import clientsix from "../imgs/Logo (6).png";
import clientseven from "../imgs/Logo (7).png";
import { Container } from "react-bootstrap";
const Footer = () => {
  return (
    <Container
      style={{ width: "1440px",height:"190px", backgroundColor: "red" }}
      className="d-flex justify-content-center"
      >
          <div> <div>
        <h1>Our Clients</h1>
        <p>We have been working with some Fortune 500+ clients</p>
      </div>
      <div style={{height:"98px"}} className="d-flex justify-content-between">
        <img src={clientone} />
        <img src={clienttwo} />
        <img src={clientthree} />
        <img src={clientfour} />
        <img src={clientfive} />
        <img src={clientsix} />
        <img src={clientseven} />
      </div></div>
     
    </Container>
  );
};

export default Footer;
